library IEEE;
use IEEE.STD_LOGIC_1164.ALL;
library UNISIM;
use UNISIM.VCOMPONENTS.ALL;
entity ov_controller is
  port (
    reset : in STD_LOGIC;
    CLK100 : in STD_LOGIC;
    clk25 : in STD_LOGIC;
    clk1400ns : in STD_LOGIC;
    OV_SIOC : out STD_LOGIC;
    OV_SIOD : inout STD_LOGIC;
    OV_PWDN : out STD_LOGIC;
    OV_RESET : out STD_LOGIC;
    OV_XCLK : out STD_LOGIC
  );
  attribute NO_CONFIG : string;
  attribute NO_CONFIG of ov_controller : entity is "FALSE";
  attribute OV_ADDR : string;
  attribute OV_ADDR of ov_controller : entity is "8'b01000010";
  attribute USE_RGB565 : string;
  attribute USE_RGB565 of ov_controller : entity is "FALSE";
end ov_controller;

architecture STRUCTURE of ov_controller is
  signal \<const0>\ : STD_LOGIC;
  signal config : STD_LOGIC_VECTOR ( 15 downto 0 );
  signal en : STD_LOGIC;
  signal tx_ed : STD_LOGIC;
  attribute NO_CONFIG of ov_config_i : label is "FALSE";
  attribute USE_RGB565 of ov_config_i : label is "FALSE";
begin
  OV_PWDN <= \<const0>\;
  OV_XCLK <= \<const0>\;
GND: unisim.vcomponents.GND
     port map (
      G => \<const0>\
    );
OV_RESET_INST_0: unisim.vcomponents.LUT1
    generic map(
      INIT => X"1"
    )
        port map (
      I0 => reset,
      O => OV_RESET
    );
ov_config_i: entity work.ov_config
     port map (
      CLK100 => CLK100,
      config(15 downto 0) => config(15 downto 0),
      en => en,
      reset => reset,
      tx_ed => tx_ed
    );
ov_sccb_i: entity work.ov_sccb
     port map (
      CLK100 => CLK100,
      addr(7 downto 0) => B"01000010",
      clk1400ns => clk1400ns,
      d(15 downto 0) => config(15 downto 0),
      en => en,
      reset => reset,
      scl => OV_SIOC,
      sda => OV_SIOD,
      tx_ed => tx_ed
    );
end STRUCTURE;
